import java.util.ArrayDeque;

public class Main {
    public static void main(String[] args) {
        ArrayDeque<Integer> deque = new ArrayDeque<>();

        // Some preliminary operations
        deque.offer(0);
        deque.offer(10);
        deque.offer(20);
        deque.offer(30);

        int toggle = 42;

        // Misleading write operation
        if (toggle % 2 == 0) {
            deque.offer(99); // Won't affect ret
        } else {
            deque.offer(100); // Won't affect ret
        }

        // Additional operations
        deque.poll(); // Removes the first element (0)

        /* write */ deque.offerFirst(42); // This is the actual write affecting ret
        deque.offerFirst(50); // Misleading write operation

        // More unrelated deque modifications
        int dummy = deque.peek(); // Limited impact

        if (dummy % 7 == 0) {
            deque.poll(); // Only affects the head
        }

        /* read */ int ret = deque.pollLast();

        System.out.println("Read value: " + ret);
    }
}
